import React, { Component } from 'react'

export class VideoDesc extends Component {
    render() {
        if(!this.props.selectedVideo){
            return <div></div>
        }
        return (
            <div>
               {this.props.selectedVideo.snippet.title} 
            </div>
        )
    }
}

export default VideoDesc
